e płatności, BLIK, karty płatnicze, Google Pay, Apple Pay','The selected currency is not supported by the Autopay payment gateway. The gateway has been disabled'=>'Wybrana waluta nie jest obsługiwana przez bramkę płatności Autopay. Bramka została wyłączona','Click the name of the data stream.'=>'Kliknij nazwę strumienia danych.','In the "Services" section, click "Data Streams".'=>'W sekcji „Usługi” kliknij „Strumienie danych”.','Unpaid order cancelled - time limit reached.'=>'Nieopłacone zamówienie anulowane - osiągnięto limit czasu.','validate_itn_hash - not valid'=>'validate_itn_hash - jest niepoprawny','Payment failed'=>'Błąd płatności','Payment statuses'=>'Statusy płatności','Google Analytics API secret'=>'Tajny klucz API','No'=>'Nie','Yes'=>'Tak','Enable Sandbox mode'=>'Włącz tryb testowy','Description'=>'Opis','You will be redirected to the page of the selected bank.'=>'Zostaniesz przekierowany na stronę wybranego banku.','PHP version is older than 7.2 so this plugin will not work. Please contact your host and ask them to upgrade.'=>'Wersja PHP jest starsza niż 7.2, więc ta wtyczka nie będzie działać. Skontaktuj się ze swoim dostawcą hostingu i poproś o aktualizację.','It looks like the developer version of the Autopay plug-in is installed instead of the production release. Remove this plugin and install it from this URL: %s'=>'Wygląda na to, że zainstalowana jest deweloperska wersja wtyczki Autopay zamiast wersji produkcyjnej. Usuń tę wtyczkę i zainstaluj ją z tego adresu URL: %s','https://wordpress.org/plugins/platnosci-online-blue-media'=>'https://wordpress.org/plugins/platnosci-online-blue-media']];